import React, { useEffect, useState } from "react";
import styled from "styled-components";
import WorkoutCard from "../components/cards/WorkoutCard";
import { LocalizationProvider } from "@mui/x-date-pickers/LocalizationProvider";
import { AdapterDayjs } from "@mui/x-date-pickers/AdapterDayjs";
import { DateCalendar } from "@mui/x-date-pickers";
import { getWorkouts,deleteWorkout } from "../api";
import { CircularProgress } from "@mui/material";
import { useDispatch } from "react-redux";

const Container = styled.div`
  flex: 1;
  height: 100vh; /* Use vh instead of % for better responsiveness */
  display: flex;
  justify-content: center;
  padding: 2rem 0; /* Use rem instead of px for better font size control */
  overflow-y: auto; /* Use auto instead of scroll to allow the browser to decide when to show the scrollbar */
  background-color: ${({ theme }) => theme.background}; /* Use a theme variable for the background color */
`;

const Wrapper = styled.div`
  max-width: 1600px;
  margin: 0 auto; /* Center the wrapper horizontally */
  padding: 0 2rem; /* Use rem instead of px for better font size control */
  display: flex;
  gap: 2rem; /* Use rem instead of px for better font size control */
  flex-wrap: wrap; /* Allow the wrapper to wrap its contents */
  @media (max-width: 600px) {
    gap: 1rem; /* Use rem instead of px for better font size control */
    flex-direction: column; /* Stack the contents vertically on small screens */
  }
`;

const Left = styled.div`
  flex-basis: 20%; /* Use flex-basis instead of flex to set the initial width */
  padding: 1.5rem; /* Use rem instead of px for better font size control */
  border: 1px solid ${({ theme }) => theme.border}; /* Use a theme variable for the border color */
  border-radius: 1rem; /* Use rem instead of px for better font size control */
  box-shadow: 1px 6px 20px 0px ${({ theme }) => theme.shadow}; /* Use a theme variable for the shadow color */
`;

const Title = styled.div`
  font-weight: 600;
  font-size: 1.5rem; /* Use rem instead of px for better font size control */
  color: ${({ theme }) => theme.text}; /* Use a theme variable for the text color */
  @media (max-width: 600px) {
    font-size: 1.25rem; /* Use rem instead of px for better font size control */
  }
`;

const Right = styled.div`
  flex: 1; /* Take up the remaining space */
`;

const CardWrapper = styled.div`
  display: flex;
  flex-wrap: wrap;
  justify-content: center;
  gap: 2rem; /* Use rem instead of px for better font size control */
  margin-bottom: 10rem; /* Use rem instead of px for better font size control */
  @media (max-width: 600px) {
    gap: 1rem; /* Use rem instead of px for better font size control */
  }
`;

const Section = styled.div`
  display: flex;
  flex-direction: column;
  padding: 0 2rem; /* Use rem instead of px for better font size control */
  gap: 2rem; /* Use rem instead of px for better font size control */
  @media (max-width: 600px) {
    gap: 1rem; /* Use rem instead of px for better font size control */
  }
`;

const SecTitle = styled.div`
  font-size: 2rem; /* Use rem instead of px for better font size control */
  color: ${({ theme }) => theme.text}; /* Use a theme variable for the text color */
  font-weight: 500;
`;

// Dark theme
const darkTheme = {
  background: '#333',
  border: '#444',
  shadow: 'rgba(0, 0, 0, 0.2)',
  text: '#fff',
  primary: '#007bff',
  text_primary: '#fff',
};

// Light theme
const lightTheme = {
  background: '#fff',
  border: '#ddd',
  shadow: 'rgba(0, 0, 0, 0.1)',
  text: '#333',
  primary: '#007bff',
  text_primary: '#333',
};

const Workouts = () => {
  const dispatch = useDispatch();
  const [todaysWorkouts, setTodaysWorkouts] = useState([]);
  const [loading, setLoading] = useState(false);
  const [date, setDate] = useState("");


    const getTodaysWorkout = async () => {
      setLoading(true);
      const token = localStorage.getItem("fittrack-app-token");
      await getWorkouts(token, date ? `?date=${date}` : "").then((res) => {
        setTodaysWorkouts(res?.data?.todaysWorkouts);
        console.log(res.data);
        setLoading(false);
      });
    };

    const handleDelete = async (workoutId) => {
      const token = localStorage.getItem("fittrack-app-token");
      await deleteWorkout(token, workoutId).then((res) => {
        if (res.status === 200) {
          setTodaysWorkouts(todaysWorkouts.filter((workout) => workout.id !== workoutId));
        }
      });
    };

    useEffect(() => {
      getTodaysWorkout();
    }, [date]);

    return (
      <Container>
        <Wrapper>
          <Left>
            <Title>Select Date</Title>
            <LocalizationProvider dateAdapter={AdapterDayjs}>
              <DateCalendar
                onChange={(e) => setDate(`${e.$M + 1}/${e.$D}/${e.$y}`)}
              />
            </LocalizationProvider>
          </Left>
          <Right>
            <Section>
              <SecTitle>Todays Workout</SecTitle>
              {loading ? (
                <CircularProgress />
              ) : (
                <CardWrapper>
                  {todaysWorkouts.map((workout) => (
                    <WorkoutCard
                      key={workout.id}
                      workout={workout}
                      onDelete={() => handleDelete(workout.id)}
                    />
                  ))}
                </CardWrapper>
              )}
            </Section>
          </Right>
        </Wrapper>
      </Container>
    );
  };
export default Workouts;
